import React from "react";

import Note from "./Note";

import "../App";

function GridLine() {
  return (
    <div className="grid-line">
      <Note index="0" />
      <Note index="1" />
      <Note index="2" />
      <Note index="3" />
      <Note index="4" />
      <Note index="5" />
      <Note index="6" />
      <Note index="7" />
      <Note index="8" />
      <Note index="9" />
      <Note index="10" />
      <Note index="11" />
      <Note index="12" />
      <Note index="13" />
      <Note index="14" />
      <Note index="15" />
    </div>
  );
}

export default GridLine;
